    // }
  return (
    <div className="container">
      
         {/* {items} */}

         {Data2.map((item,index) => {
          const {title,desc} = item;
          return(
           
            <Todo key={index} title={title} desc={desc} />
          )
         })}
  </div>
  )
}

export default Card
